  {/*        <p className="card-text text-muted">by @CalebHill</p>*/}
  {/*      </div>*/}
  {/*  </div>*/}

  const getPosts = async () => {
    try {
      const response = await fetch('/api/posts')
      const fetchedPosts = await response.json()
      setPosts(fetchedPosts.posts)
    } catch (e) {
      console.log('error',JSON.stringify(e))
    }
  }

  const renderPosts = () => {
    const postsToRender = []
    for (const post of [...posts, ...hardCodedPosts]) {
      postsToRender.push(
        (
          <div className="feed-item card" key={post._id}>
            <img src={post.imageUrl} className="card-img-top" alt={post.subject} />
            <div className="card-body">
              <h5 className="card-title">{post.title}</h5>
              <p className="card-text"><small className="text-muted">Posted by: @{post.user}</small></p>
